import "./App.css";
import { BrowserRouter, Link, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes />
      <div className="App">
        <span>Hey there Vegans</span>
        <button className="btn-style">
          <span>
            <Link to="/goVegan">CLICK HERE TO GO TO YOUR WEBSITE!</Link>
          </span>
        </button>
      </div>
    </BrowserRouter>
  );
}

export default App;
